import React, { useEffect, useState } from 'react';  
import { useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
    const [formData, setFormData] = useState({
        primerNombre: '',
        segundoNombre: '',
        primerApellido: '',
        segundoApellido: '',
        identificacion: '',
        email: '',
        fechaNacimiento: '',
        usuario: '', // El campo para el nombre de usuario
        password: '' // El campo para la contraseña
    });
    const [error, setError] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (token) {
            navigate('/'); // Redirigir a Home si hay token
        }
    }, []);

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('http://localhost:9001/Laboratorio1/persona', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(formData)
            });

            if (response.ok) {
                Swal.fire('Registro exitoso', '¡Bienvenido!', 'success');
                navigate('/login'); // Redirigir a login después de registrarse
            } else {
                const errorData = await response.json();
                setError(errorData.message || 'Error al registrar el usuario.');
            }
        } catch (error) {
            console.error("Error en el registro:", error);
            setError("Error en el registro.");
        }
    };

    return (
        <div className="container-fluid" style={{ 
            background: 'linear-gradient(to right, #c1d3ff, #c9b1ff)', 
            minHeight: '100vh', 
            padding: '20px' 
        }}>
            <h1 className="mb-4">Registro de Usuario</h1>
            {error && <div className="alert alert-danger">{error}</div>}

            <form onSubmit={handleSubmit}>
                <div className="mb-3">
                    <label htmlFor="primerNombre" className="form-label">Primer Nombre</label>
                    <input type="text" className="form-control" name="primerNombre" value={formData.primerNombre} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label htmlFor="segundoNombre" className="form-label">Segundo Nombre</label>
                    <input type="text" className="form-control" name="segundoNombre" value={formData.segundoNombre} onChange={handleChange} />
                </div>
                <div className="mb-3">
                    <label htmlFor="primerApellido" className="form-label">Primer Apellido</label>
                    <input type="text" className="form-control" name="primerApellido" value={formData.primerApellido} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label htmlFor="segundoApellido" className="form-label">Segundo Apellido</label>
                    <input type="text" className="form-control" name="segundoApellido" value={formData.segundoApellido} onChange={handleChange} />
                </div>
                
                <div className="mb-3">
                    <label htmlFor="identificacion" className="form-label">Identificación</label>
                    <input type="text" className="form-control" name="identificacion" value={formData.identificacion} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label htmlFor="email" className="form-label">Email</label>
                    <input type="email" className="form-control" name="email" value={formData.email} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label htmlFor="fechaNacimiento" className="form-label">Fecha de Nacimiento</label>
                    <input type="date" className="form-control" name="fechaNacimiento" value={formData.fechaNacimiento} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label htmlFor="usuario" className="form-label">Usuario</label>
                    <input type="text" className="form-control" name="usuario" value={formData.usuario} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label htmlFor="password" className="form-label">Contraseña</label>
                    <input type="password" className="form-control" name="password" value={formData.password} onChange={handleChange} required />
                </div>
                <button type="submit" className="btn btn-primary">Registrar</button>
            </form>
        </div>
    );
};

export default Register;
